import firebaseConfig from "./secret.json";

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const database = getDatabase(app);
const dbRef = ref(getDatabase());




function TextField({userPass}) {
  var type = "text";
  if (userPass === "password"){
    type = "password";
  }
  return (
      <div><input type={type} id={userPass}></input></div>
  );
}

function Button({onEnter}) {

  return (
    <button className="enter_button" onClick={onEnter}>enter</button>
  );
}

function getUserInfo(username){
  const db = ref(getDatabase())
  return get(child(db, '/users/' + username)).then((snapshot) => {
    return snapshot.val()
  });
}


function checkIfInDatabase(username, password, setUsername, setPassword, setElo){
  getUserInfo(username).then( (value) => {
    if (value["password"] != null && value["password"] == password){
      setUsername(username)
      setPassword(password)
      setElo(value["elo"])
    }
  });
}


function signUpUser(username, password, setUsername, setPassword, setLogin) {
  setLogin(0);
  setUsername(username);
  setPassword(password);
  setElo(1200);
  const db = getDatabase();
  set(ref(db, '/users/' + username), {
    password : password,
    elo : 1200
  });
}



function logOutUser(setUser, setPassword, setElo, setLogin){
  setUser(null);
  setPassword(null);
  setElo(null);
  setLogin(1);
}

function updateElo(username, setElo){
  getUserInfo(username).then( (value) => {
      setElo(value["elo"])
  });
}

function setDBElo(username, updatedElo){
  var db = getDatabase()

  update(ref(db, '/users/' + username), {
    elo : updatedElo
  });
  document.getElementById("debuggingthing").value = "ligmoid"
}
function loseGame(username, otherRating){
  getUserInfo(username).then( (value) => {
    var elo = value["elo"]
    var pRating = elo + 20 * (0 - 1 / (Math.pow(10, Math.abs(elo - otherRating) / 400) + 1));
    setDBElo(username, pRating);
  });
}

function winGame(username, otherRating){
  getUserInfo(username).then( (value) => {
    var elo = value["elo"]
    var pRating = elo + 20 * (1 - 1 / (Math.pow(10, Math.abs(elo - otherRating) / 400) + 1));
    setDBElo(username, pRating);
  });
}


export default function Game() {
  const [user, setUsername] = useState(null)
  const [pass, setPassword] = useState(null)
  const [elo, setElo] = useState(null)
  const [isLogin, setLogin] = useState(1)

  if (user == null){
    if (isLogin == 1){
      return (
        <div className="LoginFields">
          <h1>Username</h1>
          <TextField userPass="username"></TextField>
          <h2>Password</h2>
          <TextField userPass="password"></TextField>
          <button id="button" onClick={() => checkIfInDatabase(document.getElementById('username').value, document.getElementById('password').value, setUsername, setPassword, setElo)}>LOG IN</button>
          <p>NEW TO THE GAME? <button id="switchToLogin" onClick={() => setLogin(0)}>SIGN UP</button></p>
        </div>
      );
    }
    else{
      updateElo(username);
      return (
        <div className="abc">
          <h1>Username</h1>
          <TextField userPass="username"></TextField>
          <h2>Password</h2>
          <TextField userPass="password"></TextField>
          <button id="button" onClick={() => signUpUser(document.getElementById('username').value, document.getElementById('password').value, setUsername, setPassword, setElo, setLogin)}>SIGN UP</button>
          <p>HAVE AN ACCOUNT? <button id="switchToSignup" onClick={() => setLogin(1)}>LOG IN</button></p>
        </div>
      );
    }
  }
  else{
    updateElo()
    return (
      <div className = "lobby">
        u hve logged in :p password is {pass} elo is {elo}
        <p><button id="button" onClick={() => logOutUser(setUsername, setPassword, setElo, setLogin)}> LOG OUT!! :L</button></p>
        <p><button id="button" onClick={() => loseGame(user, 1200)}> LOSE 1V1!! D:</button></p>
        <p><button id="button" onClick={() => winGame(user, 1200)}> WIN 1V1!! :D</button></p>
        <TextField userPass="debuggingthing"></TextField>
      </div>
    );
  }
}
